import React from "React";
function Contact(){
  return(
    <div className="container py-5 my-5">
            <div className="row justify-content-center">
              <div className="col-12 col-md-6 ">
                 <h5 className="font-weight-light text-center my-5">Want to Contact?</h5>
                 <h5 className="font-weight-light text-center my-5">Mobile Number: 9999999999</h5>
                 <h5 className="font-weight-light text-center my-5">Email: iccrhelpdesk@gmail.com</h5>
              </div>
            </div>       
    </div>
  );
}
export default Contact;
